import axios from 'axios';

export async function getReadingAPI(id: number) {
    try {
        const { data } = await axios({
          method: "GET",
          url: `${baseUrl}/book/list/${id}`,
        });
        return data;
      } catch (e) {
        console.log(e);
      }
}
